import React from 'react';
import { Animated, Text, View, StyleSheet, Image, Button } from 'react-native';
import logoInnosoft from "./assets/logo-innosoft.png"
import { useSafeAreaInsets } from 'react-native-safe-area-context';

const App = () => {
  return (
    <View style={styles.container}>
      <Image 
        source={{uri: logoInnosoft}}
        style={styles.image}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: { 
    flex: 1, 
    justifyContent: 'center', 
    alignItems: 'center', 
    backgroundColor: 'white' 
  },
  title: {
    fontSize: 20, 
    color: 'black'
  },
  image: {
    height: 200, 
    width: 200,
    borderRadius: 100
  }
})

export default App;
